import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate the first "Add to Cart" button using a user-facing role selector
    const firstAddToCartButton = page.getByRole('button', { name: 'Add to Cart' }).first();
    await firstAddToCartButton.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_click.png'));

    // Click the first "Add to Cart" button
    await firstAddToCartButton.click();

    // Wait for the success notification to appear as confirmation
    const notification = page.locator('.notification.success');
    await notification.waitFor({ state: 'visible', timeout: 5000 });
    const notificationText = await notification.textContent();

    // Take a screenshot of the result
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_click.png'));

    // Verify by checking localStorage, which is more reliable than UI elements that might not update
    const cartDataString = await page.evaluate(() => localStorage.getItem('amazonCart'));
    const cartData = JSON.parse(cartDataString);

    if (!cartData || cartData.length === 0) {
      throw new Error('Product was not added to the cart in localStorage.');
    }

    return {
      success: true,
      action: "Clicked the first 'Add to Cart' button and verified the action.",
      extractedData: {
        notificationText: notificationText,
        cartItemCount: cartData.length,
        firstItemInCart: cartData[0]
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
